import React, { useState, useEffect } from 'react';
import { getArray, postArray } from '../../api/api';

import FormControl from '@material-ui/core/FormControl';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import Button from '@material-ui/core/Button';

const Chiropractors = () => {

    interface IChiropractors {
        chiropractorId: number;
        firstName: string;
        lastname: string;
        emailAddress: string;
        phoneNumber: number;
        timeCreated: Date;
    }

    const [chiropractorDetails, setchiropractorDetails] = useState<any[]>([]);

    

    useEffect(() => {
        const makeArrayRequest = async () => {
            setchiropractorDetails(await getArray());
        }
        makeArrayRequest();
    }, [])

    postData('https://chiropractor-api.azurewebsites.net/api/chiropractors', { answer: 42 })
        .then(data => {
            console.log(data); // JSON data parsed by `data.json()` call
    });


    return (
        <>
            {chiropractorDetails.map(x => <li key={x.chiropractorId}> {x.firstName} {x.firstName} {x.emailAddress} {x.phoneNumber} {x.timeCreated}</li>)}


            <FormControl>
                <InputLabel>First Name:</InputLabel>
                    <Input id="Testing" aria-describedby="helper" />
                <FormHelperText id="helper">Great Chiropractor</FormHelperText>
            </FormControl>

            <FormControl>
                <InputLabel>Last Name:</InputLabel>
                <Input id="Testing" aria-describedby="helper" />
                <FormHelperText id="helper">Chiropractor</FormHelperText>
            </FormControl>
            <Button onClick={() => console.log(data)} variant="contained" color="primary">Submit</Button>
        </>
    )
}

export default Chiropractors;
